INSERT [dbo].[Services] ([ServiceID], [ServiceName], [ServicePrice], [ImageService], [DescriptionService], [ServiceStatus], [ServiceCreated]) VALUES (N'A4VWMZeUf3', N'Painless tooth extraction', 1500000, , N'<h2><strong>TOOTH EXTRACTION &ndash; PIEZOTOME SOUND SURGICAL STUDY WITHOUT PAIN</strong></h2>

<p>You are having problems with your teeth and are advised by your doctor to have your teeth extracted, but you are still hesitant because of fear of pain.</p>

<p>Rest assured, at Tan Dinh - Tan Dinh Dental Specialists, there is a standard operating room of the Ministry of Health with advanced equipment, and a system of modern dental chairs, equipped with sterile machines, ensuring protection. Instruments used in the dental room to perform painless tooth extraction for you.</p>

<p>The technology of tooth extraction, safe and painless minor surgery is performed by a Piezotome ultrasound machine which is safe and non-invasive to the soft tissues around the teeth, making you feel comfortable and no longer obsessing about having to pull teeth.</p>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/nho-rang-khong-dau-nha-khoa-tan-dinh-3.jpg" style="height:700px; width:980px" /></p>

<h2><strong>WHEN DO WE NEED A TREATMENT?</strong></h2>

<p>Tooth extraction is a mandatory indication when the tooth has been seriously damaged and is likely to affect the adjacent healthy teeth such as:</p>

<ul>
	<li>Baby teeth come during the period of tooth replacement.</li>
	<li>Periodontal: When periodontal is severe, the tissues and bones around the teeth will be destroyed, making the teeth lose.</li>
	<li>Tooth decay: The tooth has a lot of decay, and the damaged tooth tissue, close to the gum will not be able to recover.</li>
	<li>Orthodontic - braces: Depending on the orthodontic case, you need to extract teeth to rearrange teeth according to the treatment method of the doctor.</li>
	<li>Teeth that are misaligned, underground, or deformed: Causes many complications, adversely affecting oral health.</li>
	<li>Injured teeth: The tooth is broken horizontally due to a strong impact, broken root ...</li>
</ul>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/nho-rang-khong-dau-nha-khoa-tan-dinh-8.jpg" style="height:700px; width:980px" /></p>
', 0, CAST(N'2022-07-05T02:30:31.410' AS DateTime))
INSERT [dbo].[Services] ([ServiceID], [ServiceName], [ServicePrice], [ImageService], [DescriptionService], [ServiceStatus], [ServiceCreated]) VALUES (N'D5I68uZRL5', N'Implant', 2000000, , N'<p>Implant is highly appreciated by experts in the field of dental restorations, helping to improve the chewing function of teeth as well as aesthetics. This method of restoring missing teeth is one of the modern techniques and also a method with many advantages in the treatment of dental implants.</p>

<h2><span style="font-size:24px"><strong>WHAT IS IMPLANT IMPACT?</strong></span></h2>

<p>Implant: Putting dentures made of Titanium material into the jawbone, acting like real teeth, stimulating natural growth to help the bone automatically stick to the surface of the Implant body to make it stick. tight to the jawbone.</p>

<h2><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/cay-ghep-implant-nha-khoa-tan-dinh-2.jpg" style="height:700px; width:980px" /><strong>COMPONENTS OF IMPLANT TEETH</strong></h2>

<ul>
	<li><span style="font-size:16px">Implant body: this is a small titanium post designed as a real tooth root to be implanted directly into the jawbone.</span></li>
	<li><span style="font-size:16px">Implant Abutment: a cylinder with two ends that helps the crown and the implant to stick together.</span></li>
	<li><span style="font-size:16px">Crown (Porcelain crown): made of porcelain, placed over the Implant through a joint.</span></li>
</ul>

<h2><span style="font-size:16px"><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/cay-ghep-implant-nha-khoa-tan-dinh-6.jpg" style="height:700px; width:980px" /><strong>WHY SHOULD CHOOSE THE IMPLANT IMPACT METHOD?</strong></span></h2>

<p><span style="font-size:16px">The lack of teeth in any position will greatly affect chewing, the ability to pronounce is also hindered, especially words that need to be combined with many parts such as teeth, lips, and tongue. Not only that, but tooth loss also deforms the face shape and makes the face less balanced if not treated in time. Therefore, you should choose the implant method to regain your beautiful, healthy, natural teeth.</span></p>
', 0, CAST(N'2022-06-29T13:25:11.350' AS DateTime))
INSERT [dbo].[Services] ([ServiceID], [ServiceName], [ServicePrice], [ImageService], [DescriptionService], [ServiceStatus], [ServiceCreated]) VALUES (N'HaZxZV5SGq', N'Cosmetic porcelain teeth', 1000000, , N'<h2><strong>WHAT IS A COSMETIC CONTENT?</strong></h2>

<p>Porcelain veneers are a procedure that &quot;puts on an extra layer of outerwear&quot; to help overcome damaged teeth, missing teeth, or teeth that are loose, protruding, etc. do not affect chewing function.</p>

<h2><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/rang-su-tham-my-nha-khoa-tan-dinh.jpg" style="height:835px; width:1280px" /><strong>WHAT SHOULD I GET Porcelain Teeth Restoration?</strong></h2>

<ul>
	<li>Tooth enamel is peeled and severely discolored.</li>
	<li>The shape of the teeth is not beautiful, the teeth are sparse, misaligned, and crowded.</li>
	<li>Weakened teeth due to severe caries or root canal treatment make teeth prone to fracture, loss of elasticity, brittle teeth, and a high possibility of fracture.</li>
</ul>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/rang-thua-lech.jpg" style="height:400px; width:600px" /></p>
', 0, CAST(N'2022-06-29T13:29:50.770' AS DateTime))
INSERT [dbo].[Services] ([ServiceID], [ServiceName], [ServicePrice], [ImageService], [DescriptionService], [ServiceStatus], [ServiceCreated]) VALUES (N'KFPlL3tYLi', N'Scrape tartar', 2500000, , N'<h2><strong>WHY should I shave?</strong></h2>

<p>Did you know that tartar is not only aesthetically pleasing but also an ideal home for many harmful bacteria, which directly affect oral health?</p>

<p>Therefore, you should get tartar every 6 months to thoroughly remove plaque on your teeth. So what is tartar and why should you go to get regular tartar, let&#39;s find out with Gentle Dental Care Dental Clinic!</p>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/cao-voi-rang-nha-khoa-tan-dinh-8.jpg" style="height:700px; width:980px" /></p>

<h2><strong>WHAT IS TOOTH (TARGET)?</strong></h2>

<p>Tartar (tartar) is plaque formed from excess food particles that stick and stick to the teeth and gums.</p>

<p>The address that &quot;favorite&quot; tartar clings to the surface of the teeth and around the roots is light yellow or dark yellow, which is unsightly, and adversely affects oral health.</p>

<p>Over time, these calcified plaques become harder and harder to remove with regular oral hygiene. The main cause of common oral diseases such as bad breath, periodontitis, etc.</p>

<h2><strong>SITUATIONS NEED TO Scraping LICENSE</strong></h2>

<ul>
	<li>Teeth have a lot of plaque and tartar.</li>
	<li>Weak teeth, in the process of being treated for gingivitis, periodontitis.</li>
	<li>Porcelain-coated teeth after a period of plaque.</li>
</ul>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/cao-voi-rang-nha-khoa-tan-dinh-1.jpg" style="height:700px; width:980px" /></p>
', 0, CAST(N'2022-07-05T02:36:44.557' AS DateTime))
INSERT [dbo].[Services] ([ServiceID], [ServiceName], [ServicePrice], [ImageService], [DescriptionService], [ServiceStatus], [ServiceCreated]) VALUES (N'LyjBwEazVj', N'Braces', 2000000, , N'<p>Braces (braces) are a measure to correct teeth defects such as wide teeth, overbite, underbite, crowded, incorrect position, deep bite, misalignment... However, you already know how to get braces is it true?</p>

<h2><strong>BENEFITS OF Bracelets.</strong></h2>

<ul>
	<li>Easier to clean and brush your teeth.</li>
	<li>Limit the situation of food and debris stuck between teeth.</li>
	<li>Contribute to regular orthodontic teeth, for a more harmonious face.</li>
	<li>The chewing force is distributed more evenly thanks to the correlation between the two teeth.</li>
	<li>Therefore, braces are not simply to have beautiful teeth, but also to help maintain the development and long-term oral health of the teeth.</li>
</ul>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/nieng-rang-nha-khoa-tan-dinh-7.jpg" style="height:700px; width:980px" /></p>

<h2><strong>BEST AGE FOR Orthodontic Braces.</strong></h2>

<p>From 12-16 years old (after replacing all baby teeth) is the right time for braces because, at this time, the teeth are in the developing stage, and the adjustment of teeth will take place easier. If you have passed this age, you should get braces as soon as possible to get the best orthodontic effect and the shortest time of braces, contributing to high efficiency.</p>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/nieng-rang-nha-khoa-tan-dinh-0.jpg" style="height:700px; width:980px" /></p>

<h2><strong>BRACES HURT?</strong></h2>

<p>For about 1-2 weeks after wearing braces, you will feel a little pain and toothache, but this feeling will quickly disappear. When performing braces at Tan Dinh Dental Clinic, you can be completely assured and confident in the results after braces. Because here, doctors with many years of experience in the profession can apply advanced methods of braces without affecting the tooth structure, helping to minimize pain.</p>

<h2><strong>DECIDE BEFORE BRACKETS</strong></h2>

<p>When detecting misaligned, misplaced, uneven teeth... you should immediately go to Tan Dinh Dental Clinic to be examined and consulted on whether your case needs braces or how to have braces for a treatment plan. early, in order to bring about good results as expected.</p>
', 0, CAST(N'2022-07-05T02:26:06.430' AS DateTime))
INSERT [dbo].[Services] ([ServiceID], [ServiceName], [ServicePrice], [ImageService], [DescriptionService], [ServiceStatus], [ServiceCreated]) VALUES (N'SVOnw9mI5k', N'Fillings', 3000000, , N'<h2><strong>WHAT IS COSMETIC DENTAL FILLING?</strong></h2>

<p>Cosmetic fillings are a method to help seal cavities and prevent bacteria and foreign agents from entering and destroying the tooth pulp. The cosmetic dental filling method is applied to cases where the teeth are broken, chipped, worn, deep, or have hollows and grooves on the surface.</p>

<p>Cosmetic fillings are a common dental method that helps restore teeth that have been damaged by decay, returning teeth to function. This method uses artificial materials to replace missing tooth tissue or to correct defects in the &ldquo;appearance&rdquo; of teeth.</p>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/tram-rang-nha-khoa-tan-dinh-3.jpg" style="height:700px; width:980px" /></p>

<h2><strong>WHEN DO YOU NEED A COSMETIC DENTAL?</strong></h2>

<p>Cosmetic fillings can only be performed in cases where the teeth are slightly decayed, chipped, worn on the neck, etc. In cases where the teeth are broken and painful, they need to be intervened with root canal treatment, and porcelain veneers. It is possible to restore the aesthetics and chewing function of the teeth.</p>

<ul>
	<li>Big chipped teeth.</li>
	<li>Teeth worn enamel, small gaps.</li>
	<li>Teeth after treatment of cavities, pulp.</li>
	<li>Tooth decay, early caries (have not reached the tooth pulp).</li>
</ul>

<p><img alt="" src="https://nhakhoatandinh.com/wp-content/uploads/2020/01/tram-rang-nha-khoa-tan-dinh-rang-sau-1.jpg" style="height:700px; width:980px" /></p>
', 0, CAST(N'2022-07-05T02:40:12.047' AS DateTime))
